def overlay_blend_8(base: List[List[int]], active: List[List[int]]) -> List[List[int]]:
    return matrix_map(base, lambda x: ite(x >= 128, 2 * x + x - 2 * x * x // 255 - 255, 2 * x * x // 255))


def matrix_map(
    matrix: List[List[int]], map_int_to_int: Callable[[int], int]
) -> List[List[int]]:
    return (
        []
        if len(matrix) < 1
        else [vec_map(matrix[0], map_int_to_int), *matrix_map(matrix[1:], map_int_to_int)]
    )
